import React from 'react';
import Skills from './Skills';
import About from './About';
import Projects from './Projects';
import Contact from './Contact';
import './Home.css';


const Home = () => {
    return (
        <div className="App">
            <About id="about" />
            <Skills id="skills" />
            <Projects id="projects" />
            <Contact id="contact" />
        </div>
    );
};

export default Home;
